import { Box, Button, Grid, Stack } from '@mui/material'
import React from 'react'
import Sidebar from '../../Component/Sidebar'
import Theme from '../../Component/Theme';

const theme=Theme();

export default function Home() {
  return (
    <Grid container display="flex">
      <Grid item flex={2} position="fixed"
        sx={{backgroundColor:theme.palette.primary.main,height:"100vh"

        }}>
          <Sidebar/>

      </Grid>

      <Grid item flex={10} margin={0}
        sx={{backgroundColor:theme.palette.background.normal,height:"100vh"

        }}>
          <Grid bgcolor={theme.palette.primary.main} sx={{height:70}} position="static">
            <Button></Button>
          </Grid>

      </Grid>

    </Grid>
  )
}
